import { Box, ColorModeScript } from '@chakra-ui/react';
import { MainRouter } from 'routers';

function App() {

   return (
      <Box
         h={{
            base: '100%',
            lg: '100vh'
         }}
      >
         <ColorModeScript initialColorMode="dark" />
         <MainRouter />
      </Box>
   );
}

export default App;
